import React, { Component } from 'react'
import { Letter } from "./Letter";
import './App.css';

export class Letters extends Component {

    render(){

        const letterStatuses = Object.keys(this.props.lettersStatus)
        const chosenLetters = letterStatus.filter( letter => letter == true )

        return(
            <div>
                <Letter chosenLetters={chosenLetters}/>
            </div>
        )
    }
}
